(2, 6, 2, 'Registration Note', '<h1>Register here to request for login acocunt</h1>\r\n<p><span style=\"color: #ff0000;\"><strong>Note:</strong></span></p>\r\n<p><span style=\"color: #ff0000;\">1. Please use business owner information to create the account</span><br /><span style=\"color: #ff0000;\">2. You have to fill all fields marked red star (*)</span></p>', '2017-11-08 15:11:23', 10001, '2017-11-08 15:24:12', 10001, 0, 1),
