(4, 8, 2, 'Contact Information', '<p><span>Land 3A, St. 169, Sangkat Veal Vong, Khan 7 Makara, Phnom Penh, Kingdom of Cambodia</span></p>\r\n<p><span>Tel: (+855) 23 531 0999</span></p>\r\n<p><span>Email:&nbsp;<a href=\"mailto:tourismindustry.cam@gmail.com\">tourismindustry.cam@gmail.com</a></span></p>', '2018-03-23 12:09:44', 10001, NULL, NULL, 0, 1),
(5, 10, 2, '<i class=\"icon-custom icon-bg-u fa fa-lightbulb-o\"></i> How to reset your account password', '<ol>\r\n<li>Fill you login account email and secuirty code</li>\r\n<li>Check your email inbox and find the reset link (instruction provided within the email)</li>\r\n<li>Click or copy and paste the link to the browser</li>\r\n<li>Fill your new password</li>\r\n</ol>\r\n<p><span>Having done all the above steps, you can use your new password for the further login.</span></p>\r\n<p style=\"text-align: center;\"><span>---------------</span></p>\r\n<p><span style=\"color: #ff9900;\"><em><strong>If you still have troubles with your account login, please contact us via our contact information below.</strong></em></span></p>', '2018-05-25 15:57:55', 10001, '2018-05-25 16:18:31', 10001, 0, 1),
(6, 11, 2, '<i class=\"fa fa-info-circle\"></i>Security Maintenance Notice', '<p><span><strong><span style=\"color: #ffff00;\">OTLS</span></strong> has just been&nbsp;upgraded for the security reason and better performance. Therefore, if you have issue with your login account, please contact us via <span style=\"text-decoration: underline;\"><em>023 531 0999</em></span>. Note: please do not create new&nbsp;account if you have already created&nbsp;one. Thanks!&nbsp;</span></p>', '2018-05-30 10:29:47', 10001, '2018-05-30 10:38:22', 10001, 0, 1);
