INSERT INTO `email_template` (`id`, `code`, `title`, `subject`, `content`, `content_codes`, `created_by`, `created_date`, `last_updated_by`, `last_updated_date`, `active`) VALUES
(1, 'register', 'Register', 'Your account is almost ready', '<p>Dear [{name}],</p>\r\n<p>You have successfully created an account on <strong>Cambodia Tourism Industry</strong>. Please click (or copy and paste to the browser) the bellow link to activate your account.</p>\r\n<p>[{url}]</p>\r\n<p>Have a nice day,</p>', 'name,url', 10001, '2017-10-07 00:00:00', 10001, '2018-03-20 15:14:51', 1),
(2, 'reset_pwd', 'Reset Password', 'Reset Your Password', '<p>Dear [{name}],</p>\r\n<p>You have requested your account password reset. Please click the bellow link to reset your password.</p>\r\n<p>[{url}]</p>\r\n<p>If you did not request this, please ignore this message and&nbsp;delete it from your inbox.</p>\r\n<p>Have a nice day,</p>', 'name,url', 10001, '2017-10-07 00:00:00', 10001, '2017-10-09 13:35:54', 1),
(4, 'license_status', 'License Status', 'Your License Request Status', '<p>Dear [{name}],</p>\r\n<p>You have requested a license and below is your license status:</p>\r\n<p>[{license_status}]</p>\r\n<p>View your license here: [{license_url}]</p>\r\n<p>Have a nice day,</p>', 'name,license_status,license_url', 10001, '2018-02-13 00:00:00', 10001, '2018-02-13 14:11:07', 1),
(5, 'license_status_admin', 'License Status', 'License Request Notification', '<p>Dear Admin/Officer,</p>\r\n<p>The notification system have new info as below:</p>\r\n<p>[{license_status}]</p>\r\n<p>View license here: [{license_url}]</p>\r\n<p>Have a nice day,</p>', 'license_status,license_url', 10001, '2018-02-13 05:08:09', NULL, NULL, 1),
(6, 'reset_pwd_done', 'Reset Password Done', 'Your Password Has Been Reset', '<p>Dear [{name}],</p>\r\n<p>Your account password has been reset successfully. To log into your account, please follow the below link.</p>\r\n<p>[{url}]</p>\r\n<p>Have a nice day,</p>', 'name,url', 10001, '2018-05-24 00:00:00', NULL, NULL, 1);
